 function isEqueal(s) {
     if (s.length==1) {
         return true
     }
     if (!s) {
         return false
     }
     let left_str= s.slice(0,Math.floor((s.length+1)/2))
     let right_str= s.slice(Math.floor(s.length/2))
    if ( left_str == right_str) {
        return isEqueal(left_str)  && isEqueal(right_str)
    }  
    return false 
 }
 var lastSubstring = function(s) {
    //1、找子串
    //2、去重复
    //3、排序 按字典
    if (isEqueal(s)) {
        return s
    }
    let startindex = 0
    let i = s.length-1,j = s.length-1;
    let code = s[i]
    let thesameletter = false;
        for ( j; j >=0; j--) {
            if (s[j]<code ) {
                // 'leetcode'
                //cbcb
                // break
                thesameletter = false;
                continue
            }
            if (s[j]===code && thesameletter ) {
                startindex = j;
                code = s[j]
                continue
            }
            let s1 = s.slice(j)
            let s2 = s.slice(startindex)
            if (s[j]>=code && compare(s1,s2)===s1) {
                // i = j+1
                // laststr = s.slice(j+1,i+1);
                startindex = j;
                code = s[j]
                thesameletter = true
            }
        }
        if (startindex==0) {
            return s
        }
    return s.slice(startindex)
};

function compare (str1,str2) {
    let thelongstr = str1;
    if (str2.length>str1.length) {
       thelongstr = str2
    }
    let sortedstr=''
    for (let i = 0; i < thelongstr.length; i++) {
        const e = thelongstr[i];
        let _s1 = str1[i],_s2 = str2[i],_s1code = _s1,_s2code = _s2
        if (!_s1&&!_s2) {
            break
        }else if (_s1&&!_s2) {
           sortedstr = str1
           break
        }else if (!_s1&&_s2) {
           sortedstr = str2
           break
        }else if (_s1code>_s2code) {
           sortedstr = str1
           break
        }else if (_s1code<_s2code) {
           sortedstr = str2
           break
        }else if (_s1code= _s2code) {
            continue
           // break
        }
    }
    return sortedstr
}
